import React from "react";
import ReactDOM from "react-dom";
import { Card } from "./card";
import { Export } from "./export";

ReactDOM.render(
    <React.StrictMode>
      <Container maxWidth="sm">
        <Box>
          <Export />
        </Box>
      </Container>
    </React.StrictMode>,
    document.getElementById("root")
  );
